import React from 'react';
import style from './FormInput.css'


const FormInput = ({inputChange, currentInput}) => {
    return(
        <input onChange={inputChange} className={style.input} type="text" placeholder="Add items" onfocus="this.value=''"/>
    );
}

export default FormInput;
